import React from "react";
import moment from "moment";

const SearchResults = (props) => {
  let bookingAttributes = Object.keys(props.results[0]);
  let checkIn = moment().format(props.results.checkInDate);
  let formattedCheckIn = moment(checkIn);
  let checkOut = moment().format(props.results.checkOutDate);
  let formattedCheckOut = moment(checkOut);
  let nights = formattedCheckOut.diff(formattedCheckIn, "days");

  return (
    <table className="table">
      <thead className="thead-dark">
        <tr>
          {bookingAttributes.map((att, index) => {
            return (
              <th scope="col" key={index}>
                {att}
              </th>
            );
          })}
          <th scope="col" key="9">
            nights
          </th>
        </tr>
      </thead>
      <tbody>
        {props.results.map((att, index) => {
          return (
            <tr key={index}>
              <td>{att.id}</td>
              <td>{att.title}</td>
              <td>{att.firstName}</td>
              <td>{att.surname}</td>
              <td>{att.email}</td>
              <td>{att.roomId}</td>
              <td>{att.checkInDate}</td>
              <td>{att.checkOutDate}</td>
              <td>{nights}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default SearchResults;
